  margin: 20px;
  padding-bottom: 30px;
  background: white;
  border-radius: 10px;
  display: flex;
  flex-direction: column;
  align-items: center;
`

const SideBarItem = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
`

const SideBarTitle = styled.span`
  margin: 10px;
  padding: 5px;
  width: 80%;
  border-top: 1px solid #a7a7a4;
  border-bottom: 1px solid #a7a7a4;
  font-size: 12px;
  color: #222;
  line-height: 20px;
  text-align: center;
`
const ProfileImage = styled.img`
  margin-top: 15px;
  width: 100%;
`

const Bio = styled.p`
  padding: 30px;
`

const SideBarList = styled.ul`
  list-style: none;
`

const SideBarListItem = styled.li`

`

